import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar/Navbar';
import Home from './pages/Home/Home';
import Login from './pages/Login/Login';
import TrailDetails from './pages/TrailDetails/TrailDetails'; // Import the TrailDetails component
import './App.css';

function App() {
  return (
    <Router>
      <div className="app">
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />  {/* This will render the homepage */}
          <Route path="/login" element={<Login />} />
          <Route path="/trails/:id" element={<TrailDetails />} /> {/* Trail details route */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
